1 - Tire todas as medidas do lado direito do corpo;
 2 - Cuidadosamente, identifique e marque os locais de medidas;
 3 - Segure a dobra cutânea firmemente entre o polegar e o indicador (podendo também pegar com o dedo médio) esquerdos. Esses dedos devem ter um afastamento, formando a letra "L";
 4 - Os dedos devem sempre ficar apontados para baixo quando a dobra for vertical, apontados para a esquerda quando for horizontal e apontados para baixo na diagonal quando a dobra for diagonal;
 5- O compasso deve ser segurado com a mão direita e colocado 1 cm abaixo do pinçamento com os dedos, na mesma profundidade destes; 6- mantenha a dobra segurada enquanto a medida é feita;
 7 - Deixe o compasso na posição de medida cerca de , no máximo, 4 segundos;
 8 - Evite duas medidas consecutivas no mesmo local;
 9 - Preferencialmente, faça três tomadas em circuito e utilize a mediana (ou seja, exclua os valores maior e menor e utilize como resultado final o valor mediano);
 10 - Atenção ao direcionamento das dobras: Elas podem ser verticais, horizontais e diagonais (ou oblíquas). O direcionamento é da dobra, e não do compasso. Nas dobras verticais, por exemplo, o compasso assume uma posição horizontal, mas devemos dar importancia à direção da dobra. Normalmente, está relacionada a direção das fibras musculares em que a dobra está sendo medida;
 11 - Evite mensurar as medidas do avaliado após este ter realizado atividade física;
 12 - Cabe ressaltar que não existe diferença nos procedimentos técnicos de medida das dobras em crianças, os adultos ou idosos. Os procedimentos são os mesmos; o que difere é a equação a ser utilizada para o cálculo de percentual de gordura.

1- Pratique, no mínimo, entre 50 e 100 clientes;
 2- Treine sempre com um técnico bem capacitado e experiente;
 3- Siga os procedimentos-padrões;
 4- Marque todos os pontos antes de medir;
 5- Use as equações específicas para encontrar os resultados;
 6- Esteja atento as novas informações sobre este assunto.

